import React from 'react';
import "./input.css"

export const Input = () => {

    const handleSubmit = (event : Event) => {
        event.preventDefault();
      }

    return (
        <form action="submit" className="inputForm">
            <input type="text" className="inputField"></input>
            <button className="input-btn">Change</button>
        </form>
    )
}
